Het Zusje van Katia (2008) 

Nederland
Drama
81 minuten

geregisseerd door Mijke de Jong
met Betty Qizmolli, Julia Seykens en Olga Louzgina

Portret van een 13 jarig meisje in Amsterdam dat haar Russische moeder en oudere zus Katia &quot;verliest&quot; aan de harde wereld van de prostitutie. Zusje blijft alleen achter in een flat aan het IJ-plein. Maar toch blijft ze de wereld, hoe wreed ook, onbevangen en met een onvoorwaardelijke liefde tegemoet treden.



